import React from 'react'
import { ReactDOM } from 'react-';
function App() {
  const expenses = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  return (
    <div>
      <div class='expenses'>
        <div class='expense-item'>
          <div class='expense-date'>
            <div class='expense-date__month'>August</div>
            <div class='expense-date__year'>2020</div>
            <div class='expense-date__day'>14</div>
          </div>
          <div class='expense-item__description'>
            <h2>some item</h2>
            <div class='expense-item__price'>$300</div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
